import React, { Component } from 'react';

class SignUp extends Component {
    constructor(props) {
        super(props);
        this.email = '';
    }



    render() {
        return (

            <div>
            <div> Sign Up </div>

                <input type="email" name="email"></input>/>
            </div>

        );
    }
}

export default SignUp;
